Here are a few simple ways to host static content with Node.js:

1. Use the built-in `http` module:

```js
const http = require('http');
const fs = require('fs');

http.createServer((req, res) => {
  fs.readFile('.\/index.html', (err, data) => {
    if (err) throw err;
    res.writeHead(200, {'Content-Type': 'text\/html'});  
    res.end(data);  
  });
}).listen(8000);
```

2. Use the `serve-static` middleware:

```js
const express = require('express');
const serveStatic = require('serve-static');

const app = express();

app.use(serveStatic(__dirname + '\/public'));

app.listen(3000);
```

3. Use the `static` middleware in Express:

```js 
const express = require('express');

const app = express();

app.use(express.static('public'));

app.listen(3000);
```

The built-in `http` module provides the most basic functionality. But `serve-static` and Express `static` middleware make it a bit simpler by serving the files for you.

Here is an explanation of how to generate the Fibonacci sequence in JavaScript:

The Fibonacci sequence is a series of numbers where each number is the sum of the two preceding ones, starting from 0 and 1. So the sequence goes 0, 1, 1, 2, 3, 5, 8, 13, 21 etc.

Here is how to generate this sequence in JavaScript:

1. Create a function called fibonacci that takes a number n as an argument. This will be the number of Fibonacci numbers we want to generate.

2. Inside the function, initialize an empty array called sequence to store the Fibonacci numbers. 

3. Add 0 and 1 as the first and second numbers in the sequence.

4. Use a for loop to iterate n times, starting from 2 (since we already have the first two numbers).

5. Inside the loop, calculate the next number by adding the previous two numbers in the sequence (sequence[i-1] + sequence[i-2]) and push it to the array.

6. After the loop, return the sequence array.

Here is the code:

```js
function fibonacci(n) {
  let sequence = [0, 1];

  for (let i = 2; i < n; i++) {
    sequence[i] = sequence[i - 1] + sequence[i - 2]; 
  }

  return sequence;
}
```

To get the first 7 Fibonacci numbers, we call:

```js
fibonacci(7); 
\/\/ Returns [0, 1, 1, 2, 3, 5, 8]
```

So this dynamically generates the first n Fibonacci numbers by storing the sequence in an array and adding each new number to it.

