A switch statement in Java is used to evaluate an expression and then execute a block of code based on the result of the evaluation. Here is an example of a switch statement in Java:

```java
int day = 3;

switch (day) {
    case 1:
        System.out.println("Today is Monday");
        break;
    case 2:
        System.out.println("Today is Tuesday");
        break;
    case 3:
        System.out.println("Today is Wednesday");
        break;
    case 4:
        System.out.println("Today is Thursday");
        break;
    case 5:
        System.out.println("Today is Friday");
        break;
    case 6:
        System.out.println("Today is Saturday");
        break;
    case 7:
        System.out.println("Today is Sunday");
        break;
    default:
        System.out.println("Invalid day");
}
```

In this example, the variable `day` is evaluated in the switch statement. Depending on the value of `day`, different messages will be printed. If `day` is not defined as one of the cases, the `default` case will be executed and will print "Invalid day". The `break` statements are used to terminate the switch block and prevent the execution from falling through to the next case.

