```verilog
module wifi_tsu_extractor(
    input clk,
    input reset,
    input [7:0] wifi_data,
    output reg [15:0] tsu_value
);

parameter IDLE = 2'd0; 
parameter HEADER = 2'd1;
parameter PAYLOAD = 2'd2;

reg [1:0] state; 
reg [15:0] header_reg;
reg [7:0] byte_count;

always @(posedge clk) begin
    if(reset) begin
        state <= IDLE;
        byte_count <= 0;
        tsu_value <= 0;
    end
    else begin
        case(state)
            IDLE: begin
                if(wifi_data[7:0] == 8'hAA) 
                    state <= HEADER;
                else
                    state <= IDLE;
            end

            HEADER: begin
                header_reg[byte_count*8 +: 8] <= wifi_data;
                byte_count <= byte_count + 1;
                if(byte_count == 2) begin 
                    state <= PAYLOAD;
                    byte_count <= 0;
                end
            end

            PAYLOAD: begin
                if(byte_count < 2) begin
                    tsu_value[byte_count*8 +: 8] <= wifi_data; 
                    byte_count <= byte_count + 1;
                end
                else begin
                    state <= IDLE;
                end
            end
        endcase
    end
end

endmodule
```

