function generateArrayOfObjects(data, currentObject) {
  const result = {
    name: currentObject.name,
    code: currentObject.code
  };

  if (currentObject.children.length > 0) {
    result.children = currentObject.children.map(child => ({
      name: child.name,
      code: child.code
    }));
  }

  return result;
}

function recursiveFunction(data, currentPath = data) {
  const arrayOfObjects = currentPath.map(currentObject => {
    return generateArrayOfObjects(data, currentObject);
  });

  if (currentPath.some(object => object.children.length > 0)) {
    return recursiveFunction(data, currentPath.find(object => object.children.length > 0).children);
  } else {
    return arrayOfObjects;
  }
}

const result = recursiveFunction(datatest);

