Here's a simple Kotlin function that takes a list, page number, and page size as input and returns a sublist of the specified page:

```kotlin
fun <T> getPage(list: List<T>, page: Int, pageSize: Int): List<T> {
    if (page < 0 || pageSize <= 0 || pageSize > list.size) {
        throw IllegalArgumentException("Invalid page or page size")
    }

    val startIndex = page * pageSize
    return if (startIndex >= list.size) {
        \/\/ Return an empty list if the requested page is out of bounds
        emptyList()
    } else {
        list.subList(startIndex, minOf(startIndex + pageSize, list.size))
    }
}
```

This function performs basic validation of the input parameters and returns a sublist of the input list starting from the `startIndex` up to, but not exceeding, the end of the list. If the requested page is out of bounds, it returns an empty list.

Here's an example of how to use the function:

```kotlin
val myList = (1..20).toList()
println(getPage(myList, 2, 5))  \/\/ Prints [11, 12, 13, 14, 15]
```

