        swapped = false;
        for (RandomIter current = begin; current != end - 1; ++current) {
            RandomIter next = current + 1;
            if (comp(*next, *current)) {
                std::swap(*next, *current);
                swapped = true;
            }
        }

        if (!swapped) {
            break;
        }

    }

}
```

In this optimized version, we added a `swapped` flag, which is set to `false` at the beginning of each outer loop iteration. During each inner loop iteration, if a swap is made, `swapped` is set to `true`. After the inner loop finishes, if `swapped` is still `false`, that means no swaps were made in that inner loop iteration, and the remaining elements are already sorted. In this case, we can exit the outer loop early using the `break` statement.
