        \/\/ Deserialize a JSON string to an object.
        Person deserializedPerson = (Person)serializer.ReadObject(jsonString);
        Console.WriteLine(deserializedPerson.Name); \/\/ Output: Alice Smith
        Console.WriteLine(deserializedPerson.Age); \/\/ Output: 25
    }
}
```

Please note that `DataContractJsonSerializer` is a bit more complex to use and requires that your class be decorated with `DataContract` and `DataMember` attributes for proper serialization and deserialization.

