Here is a typescript function that returns a random pastel color based on the input string:

```typescript
function getPastelColor(str: string): string {
  \/\/ Hash the input string to get a number
  let hash = 0;
  for (let i = 0; i < str.length; i++) {
    hash = str.charCodeAt(i) + ((hash << 5) - hash);
  }

  \/\/ Generate R, G, B values between 0 and 255
  const r = (hash % 256); 
  const g = ((hash >> 8) % 256);
  const b = ((hash >> 16) % 256);

  \/\/ Convert to 0-1 range and make pastel
  const red = r \/ 255;
  const green = g \/ 255;  
  const blue = b \/ 255;

  \/\/ Build and return hex 
  const hex = '#' + 
    ('00' + Math.round(red * 255).toString(16)).slice(-2) +
    ('00' + Math.round(green * 255).toString(16)).slice(-2)  + 
    ('00' + Math.round(blue * 255).toString(16)).slice(-2);

  return hex;
}
```

This converts the input string into a numeric hash, extracts RBG values from that hash, adjusts them to be pastel colors between 0-1, and then builds a hex code. The same input string will always produce the same output, but different strings will produce different pastels.

